import { TestBed } from '@angular/core/testing';
import { StartPageComponent } from './start-page.component';
import { ReactiveFormsModule } from "@angular/forms";
import { RouterTestingModule } from "@angular/router/testing";
import { StoreModule } from "@ngrx/store";
import { SocialAuthService } from "angularx-social-login";
describe('StartPageComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        await TestBed.configureTestingModule({
            declarations: [StartPageComponent],
            imports: [
                ReactiveFormsModule, RouterTestingModule, StoreModule.forRoot({})
            ],
            providers: [
                SocialAuthService
            ]
        })
            .compileComponents();
        fixture = TestBed.createComponent(StartPageComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        let socAuthService = fixture.debugElement.injector.get(SocialAuthService);
        expect(component).toBeTruthy();
    });
    it(`should have as title 'calorie calendar'`, () => {
        const fixture = TestBed.createComponent(StartPageComponent);
        const component = fixture.componentInstance;
        expect(component.title).toEqual('calorie calendar');
    });
});
